  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Arrowwood NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Arrowwood NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, and information about the management
  direction. Key planning issues include: water quantity, invasive plants, visitor
  services, agriculture, wildlife depredation, naturalness, and economic benefits.\",\n\t\"owner_org\":
